- input: "TEXT\x1CC00030718\x1C1\x1C\x1CF3XA\x1C7/02/13: This is in response to your
    letter dated 6/04/13. We are amending our 2012  30 Day Post-General Report (10/18/12-11/26/12)
    to update Line 24 with an independent expenditure to SSG Media supporting Michael
    Fitzpatrick in the amount of $400,000.00 which was originally included on a 24
    hour report filed on 10/18/12 but inadvertently left off of Schedule E, Line 24
    of our 30 Day Post-General report covering that period and filed on 12/05/12.
    Also, we will be updating Line 21b totals due to transferring this independent
    expenditure from Line 21b to Line 24.  This amount was previously reported on
    Line 21b on the 2012 October Monthly report as an advance payment to SSG Media
    for an independent expenditure to be disseminated in a future period. Those are
    the only two changes made to this report.        For Line 21b of this report,
    a negative amount is reflected for the following items on Line 21b of this report
    and a corresponding positive amount is reflected on Line 24. For the Line 21b
    negative entries, the full purpose of disbursement should be noted as Transfer
    to Line 24, Independent Expenditures disseminated. For the Line 24 corresponding
    positive entries, the full purpose of disbursement for each is: Transfer polling
    costs from Line 21b to Line 24 due to public dissemination of independent expenditure
    communication.  Items are: SSG Media Inc  $400,000.00 on 10/19/12 for Gary Miller;
    SSG Media Inc $ 260,625.00 for Tom Reed; SSG Media Inc $500,000.00 for Judy Biggert
    and DDC Advocacy   $37,000.00 on 10/23/12 for Judy Biggert. For the five $100.00
    contra disbursements on Line 21b, dated 10/18/12, 10/19/12 & 10/23/12, they relate
    to an $8,000.00 advance payment made on 4/16/12 to the National Association of
    Realtors (NAR) for consulting services and reported on Line 21b of the May 2012
    monthly report.  In 2012, we have applied & reported $700.00 of this advance payment
    for consulting services attributable to In-Kind events & reflected as negative
    amounts subtracted from Line 21b and transferred to Line 23 and have applied &
    reported $1,325.00 of this advance payment for consulting services attributable
    to Independent Expenditures & reflected as negative amounts subtracted from Line
    21b and transferred to Line 24. In the current 30-Day Post Election reporting
    period, the five contra disbursements mentioned above, totaling $500.00, relate
    to Independent Expenditure payments for consulting services in connection with
    Gary Miller (CA-31), Tom Reed (NY-23) & Judy Biggert (IL-13)  as reported on Schedule
    E, Line 24. For Line 22 of this report, the disbursements to Florida RPAC for
    $105.30 on 10/29/12, Indiana RPAC for $2,540.00 on 10/29/12 & Oregon RPAC for
    $ 160.80 on 10/29/12 represent refunds for transmissions of funds inadvertently
    sent in error by the respective state agent.\n"
